function robotSim(commands: number[], obstacles: number[][]): number {
    let xRobot = 0, yRobot = 0;
    let facing = 0;
    let furthestDistance = 0;

    for (let i = 0; i < commands.length; i++) {
        const command = commands[i];

        if (command === -1) {
            facing += 1;
            if (facing === 4) { facing = 0; }
        } else if (command === -2) {
            facing -= 1;
            if (facing === -1) { facing = 3; }
        } else {
            let xDelta = 0, yDelta = 0;
            for (let j = 0; j < command; j++) {

                switch (facing) {
                    case 0: yDelta++; break;
                    case 1: xDelta++; break;
                    case 2: yDelta--; break;
                    case 3: xDelta--; break;
                }

                if (obstacles.find(x => x[0] === (xRobot + xDelta) && x[1] === (yRobot + yDelta))) {
                    switch (facing) {
                        case 0: yDelta--; break;
                        case 1: xDelta--; break;
                        case 2: yDelta++; break;
                        case 3: xDelta++; break;
                    }

                    break;
                }
            }

            xRobot += xDelta;
            yRobot += yDelta;
            furthestDistance = Math.max(furthestDistance, Math.pow(xRobot, 2) + Math.pow(yRobot, 2));
        }
    }

    return furthestDistance;
};

